import React from 'react';
import Li from './itemMenu.js';

//console.log('Instanciando templates/index.js');
const ListadeRotasHTML = function (props) {
  const regiao = props.regiao;
  const modo = props.modo;
  const btestiloitem = props.btestiloitem;
  return (
              <div>
                <Li modo={modo} href="/tutorial/html/" regiao={regiao} btestiloitem={btestiloitem}>}>HTML5 Introdução</Li>
                <Li modo={modo} href="/tutorial/html/estrutura/" regiao={regiao} btestiloitem={btestiloitem}>}>Estrutura da Página</Li>
                <Li modo={modo} href="/tutorial/html/h1_p_br/" regiao={regiao} btestiloitem={btestiloitem}>}>Titulo, Parágrafo</Li>
                <Li modo={modo} href="/tutorial/html/lista01/" regiao={regiao} btestiloitem={btestiloitem}>}>Listas Não ordenada</Li>
                <Li modo={modo} href="/tutorial/html/lista02/" regiao={regiao} btestiloitem={btestiloitem}>}>Listas Ordenada 1</Li>
                <Li modo={modo} href="/tutorial/html/lista03/" regiao={regiao} btestiloitem={btestiloitem}>}>Listas Ordenada A</Li>
                <Li modo={modo} href="/tutorial/html/lista04/" regiao={regiao} btestiloitem={btestiloitem}>}>Listas Ordenada i</Li>
                <Li modo={modo} href="/tutorial/html/lista05/" regiao={regiao} btestiloitem={btestiloitem}>}>Listas Ordenada I</Li>
                <Li modo={modo} href="/tutorial/html/lista06/" regiao={regiao} btestiloitem={btestiloitem}>}>Listas Com descrição</Li>
                <Li modo={modo} href="/tutorial/html/img/" regiao={regiao} btestiloitem={btestiloitem}>}>Imagem</Li>        
                <Li modo={modo} href="/tutorial/html/img_figcaption/" regiao={regiao} btestiloitem={btestiloitem}>}>Figure e Figcaption</Li>
                <Li modo={modo} href="/tutorial/html/iframe/" regiao={regiao} btestiloitem={btestiloitem}>}>Iframe</Li>
                <Li modo={modo} href="/tutorial/html/links/" regiao={regiao} btestiloitem={btestiloitem}>}>Links - tag A</Li>
                <Li modo={modo} href="/tutorial/html/tabela/" regiao={regiao} btestiloitem={btestiloitem}>}>Tabelas</Li>
                <Li modo={modo} href="/tutorial/css/css13/" regiao={regiao} btestiloitem={btestiloitem}>}>Tabelas Style</Li>
                <Li modo={modo} href="/tutorial/html/div_span/" regiao={regiao} btestiloitem={btestiloitem}>}>Div e Span</Li>
                <Li modo={modo} href="/tutorial/html/comentario/" regiao={regiao} btestiloitem={btestiloitem}>}>Comentários</Li>
                <Li modo={modo} href="/tutorial/html/meta/" regiao={regiao} btestiloitem={btestiloitem}>}>Meta Tag</Li>
                {/* <Li modo={modo} href="/tutorial/html/" regiao={regiao} btestiloitem={btestiloitem}>}>Midia Audio</Li>*/}
                {/* <Li modo={modo} href="/tutorial/html/" regiao={regiao} btestiloitem={btestiloitem}>}>?Midia Vídeo</Li>*/}
                {/* <Li modo={modo} href="/tutorial/html/" regiao={regiao} btestiloitem={btestiloitem}>}>?Midia Video (Criando legendas)</Li>*/}
                {/* <Li modo={modo} href="/tutorial/html/" regiao={regiao} btestiloitem={btestiloitem}>}>?Midia Object</Li> */}
                <Li modo={modo} href="/tutorial/html/form01/" regiao={regiao} btestiloitem={btestiloitem}>}>Formulários</Li>
                <Li modo={modo} href="/tutorial/html/form02/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Legenda</Li>
                <Li modo={modo} href="/tutorial/html/form03/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Atributos</Li>
                <Li modo={modo} href="/tutorial/html/form04/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Radio Checkbox</Li>
                <Li modo={modo} href="/tutorial/html/form05/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Range Color</Li>
                <Li modo={modo} href="/tutorial/html/form06/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Date Time</Li>
                <Li modo={modo} href="/tutorial/html/form07/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Button</Li>
                <Li modo={modo} href="/tutorial/html/form08/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Select Optgroup</Li>
                <Li modo={modo} href="/tutorial/html/form09/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Datalist</Li>
                <Li modo={modo} href="/tutorial/html/form10/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Keygen</Li>
                <Li modo={modo} href="/tutorial/html/form11/" regiao={regiao} btestiloitem={btestiloitem}>}>Form: Submit externo</Li>
                {/* <Li modo={modo} href="/tutorial/html/form01/" regiao={regiao} btestiloitem={btestiloitem}>}>?Formulário Autocomplete e Placeholder</Li>*/}
                {/* <Li modo={modo} href="/tutorial/html/form01/" regiao={regiao} btestiloitem={btestiloitem}>}>?Formulário Types: File, Hidden, Search, URL, Tel</Li>*/}
                {/* <Li modo={modo} href="/tutorial/html/form01/" regiao={regiao} btestiloitem={btestiloitem}>}>?Formulário Textarea, Spellcheck</Li>*/}
                {/* <Li modo={modo} href="/tutorial/html/form01/" regiao={regiao} btestiloitem={btestiloitem}>}>?Formulários Form, Formaction, Formmethod, Formenctype, Formnovalidate</Li> */}
                <Li modo={modo} href="/tutorial/html/mark/" regiao={regiao} btestiloitem={btestiloitem}>}>Mark e Contenteditable</Li>
                <Li modo={modo} href="/tutorial/html/tabindexaccesskey/" regiao={regiao} btestiloitem={btestiloitem}>}>Tabindex e Accesskey</Li>
                <Li modo={modo} href="/tutorial/html/details/" regiao={regiao} btestiloitem={btestiloitem}>}>Details</Li>
                <Li modo={modo} href="/tutorial/html/hgroup/" regiao={regiao} btestiloitem={btestiloitem}>}>Hgroup</Li>
                <Li modo={modo} href="/tutorial/html/meterprogress/" regiao={regiao} btestiloitem={btestiloitem}>}>Meter e Progresse</Li>
                <Li modo={modo} href="/tutorial/html/links/" regiao={regiao} btestiloitem={btestiloitem}>}>Tag a</Li>
                <Li modo={modo} href="/tutorial/html/map/" regiao={regiao} btestiloitem={btestiloitem}>}>Imagem MAP</Li>          
                <Li modo={modo} href="/tutorial/html/timedatetime/" regiao={regiao} btestiloitem={btestiloitem}>}>Time e Datetime</Li>
                <Li modo={modo} href="/tutorial/html/semantica/" regiao={regiao} btestiloitem={btestiloitem}>}>Semantica</Li>
                <Li modo={modo} href="/tutorial/html/canvas/" regiao={regiao} btestiloitem={btestiloitem}>}>Canvas</Li>
              </div>
  )
}

export default ListadeRotasHTML
